$(() => {
    // 验证码（yzm)
        var yzmshow = document.getElementById("yzmshow");
        var yzmwrite = document.getElementById("yzmwrite");
        var a =getRandomNum(0,9);
        var b =getRandomNum(0,9);
        var c =getRandomNum(0,9);
        var d =getRandomNum(0,9);
        // console.log($("#yzmhuan"));
        yzmshow.value = "" + a + b + c + d;
        $("#yzmhuan").click(()=>{
            var a =getRandomNum(0,9);
            var b =getRandomNum(0,9);
            var c =getRandomNum(0,9);
            var d =getRandomNum(0,9);
            yzmshow.value = "" + a + b + c + d;
        });
    var register = false;
    $("#pass1").focusout(() => {//blur()
        // if($("#dd").val().trim()===""){
        //     $("#dd").html("请输入手机号");
        // }
        var phone = document.getElementById('pass1').value;
        var pass = $("#pass1").val().trim();
        var word = $("#word1").val().trim();
        if(!/^1[3-8]\d{9}$/.test(phone)){
            $("#dd").html("你的电话号码不满足条件");
            return false;//阻止默认行为
        }
        else{
             $.getJSON("../api/id.php", { "pass": pass }, function (res) {
                if (res) {
                    $("#dd").html("This user name is available.");
                    register = true;
                } else {
                    $("#dd").html("Try another one ?");
                    register = false;
                }
            })
        }
        $("#register1").focusout(()=>{
            if(yzmwrite.value==yzmshow.value){
                    $("#dd2").html("");
                }
            if(word!==""){
                $("#dd3").html("");
            }
        })
        $("#register1").click(() => {
            var pass = $("#pass1").val().trim();
            var word = $("#word1").val().trim();
            if (register) {
                if(pass==""){
                    $("#dd").html("手机不能为空");
                    return false;
                }
                if(yzmwrite.value!==yzmshow.value){
                    yzmshow.value = "" + a + b + c + d;
                    yzmwrite.value = "";
                    $("#dd2").html("您的验证码输入错误");
                    return false;
                }
                if(word==""){
                    $("#dd3").html("密码不能为空");
                    return false;
                }
                else{
                    if(register){
                         $.getJSON("../api/register.php", { "pass": pass, "word": word }, function (res) {
                        location.href = "../index.html?id="+res[0].id;
                    // console.log(res);
                        })
                    }
                   
                }
            }
             else {
                alert("请输入您的手机号");
            }
        })
    })
})
